import Header from "./components/header/header";
import Main from "./components/main/main";
import Footer from "./components/footer/footer";
import Step1 from "./components/step1/step1";
import Exercise from "./components/exercise/exercise";
import Step2 from "./components/step2/step2";
import Step3 from "./components/step3/step3";
import Help from "./components/help/help";
import Back from "./components/back/back";
import Wakeup from "./components/wakeup/wakeup";
import Record from "./components/record/record";
import { Routes, Route, BrowserRouter as Router} from "react-router-dom";
import React, { useState } from "react";

function App() {
  const [sound, setSound] = useState("sound1");
  const [alertt, setAlertt] = useState(0);
  const sound1 = new Audio('/src/sound1.mp3');
    const sound2 = new Audio('/src/sound2.mp3');
    const sound3 = new Audio('/src/sound3.mp3');
    const sound4 = new Audio('/src/sound4.mp3');
  return (
  <Router>
    <div className="App">
      <Header sound = {sound} setSound = {setSound}/>
      <Routes>
      <Route path="/" element = {<Main/>} />
      <Route path="/start/step1" element = {<Step1/>} />
      <Route path="/start/step2" element = {<Step2 alertt = {alertt} setAlertt = {setAlertt} />} />
      <Route path="/start/step3" element = {<Step3 sound = {sound} sound1 = {sound1} sound2 = {sound2} sound3 = {sound3} sound4 = {sound4} alertt = {alertt} />} />
      <Route path="/exercise" element = {<Exercise/>} />
      <Route path="/exercise/back" element = {<Back/>} />
      <Route path="/exercise/wakeup" element = {<Wakeup/>} />
      <Route path="/help" element = {<Help/>} />
      <Route path="/record" element = {<Record/>} />
      </Routes>
      <Footer />
    </div>
  </Router>
  );
}

export default App;
